import React from "react";
import "./checklist.scss";
import { checkListLinks } from "../../constants";

const CheckList = () => {
    return (
        <main className="page-main">
            <div className="page-main__wrapper wrapper">
                <table className="checklist-container">
                    <thead>
                        <tr>
                            <th>
                                <h1>Unit</h1>
                            </th>
                            <th>
                                <h1>Role</h1>
                            </th>
                            <th>
                                <h1>Checlist</h1>
                            </th>
                            <th>
                                <h1>Task Test</h1>
                            </th>
                            <th>
                                <h1>Task Test 2</h1>
                            </th>
                        </tr>
                    </thead>
                    <tbody>
                        {checkListLinks.map((link) => {
                            return (
                                <tr key={link.id}>
                                    <td>{link.unit}</td>
                                    <td>{link.unit}</td>
                                    <td>{link.role}</td>
                                    <td>
                                        <a
                                            href={link.shortLink}
                                            target="_blank"
                                            rel="noopener noreferrer"
                                        >
                                            {link.shortLink}
                                        </a>
                                    </td>
                                    <td>
                                        <a
                                            href={link.shortLink2}
                                            target="_blank"
                                            rel="noopener noreferrer"
                                        >
                                            {link.shortLink2}
                                        </a>
                                    </td>
                                </tr>
                            );
                        })}
                    </tbody>
                </table>
            </div>
        </main>
    );
};

export default CheckList;
